import React from 'react';
import {setsnekAC} from "../../../../../Redux/Menu/sneks-reducer";
import {connect} from "react-redux";
import Sneks from "./Sneks";


let mapDispatchToProps = (dispatch) => {

    return {
        setUser: (users) => {
            dispatch(setsnekAC(users));
        },

    }

}

let mapStateToprops = (state) => {

    return {
        sneks: state.sneksPage.sneks
    }


}

const SneksContainer = connect(mapStateToprops, mapDispatchToProps)(Sneks);
export default SneksContainer
